import React, { Component } from 'react'

export default class Task extends Component {
    render() {
        return (
            <div className="Task notification is-success" draggable="true">
                <button className="delete"></button>
                <label>{this.props.obj.name}</label><br />
                <span className="tag">{this.props.obj.owner}</span>
                <br/>
                <em>{this.props.obj.priority}</em>
                <br />
                <label>
                    <span className="icon is-left "><i className="fa fa-calendar"></i> </span> {this.props.obj.deadline.toString()}
                </label>
            </div>
        )
    }
}
